import React, { useEffect, useState } from "react";

const DoctorList = () => {
  const [doctors, setDoctors] = useState([]);
  const [error, setError] = useState("");
  const token = localStorage.getItem("token");

  useEffect(() => {
    const fetchDoctors = async () => {
      try {
        console.log("Fetching with token:", token);

        const response = await fetch(
          "https://qa-uaesaas-api.instapract.ae/web/api/doctor/doc-list",
          {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
              APPID: "Gem3s12345",
              Authorization: `Bearer ${token}`,
            },
            body: JSON.stringify({}),
          }
        );

        const data = await response.json();
        console.log("Doctors List API Response:", data);

        if (response.ok && Array.isArray(data.data)) {
          setDoctors(data.data);
        } else {
          setDoctors([]);
          setError(data.message || "No doctors found.");
        }
      } catch (err) {
        console.error("Error fetching doctor list:", err);
        setError("Failed to fetch doctor list.");
      }
    };

    if (token) {
      fetchDoctors();
    } else {
      console.warn("No token found in localStorage.");
      setError("You must log in first.");
    }
  }, [token]);

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Doctors List</h2>
      {error && <p className="text-red-500 mb-4">{error}</p>}
      {doctors.length === 0 && !error ? (
        <p className="text-gray-500">No doctors found.</p>
      ) : (
        <ul className="grid gap-4 grid-cols-1 sm:grid-cols-2 md:grid-cols-3">
          {doctors.map((doc, index) => {
            const name = doc.name || doc.doctor_name || doc.full_name || "No Name";
            const profilePic = doc.profile_pic || "https://via.placeholder.com/100";
            const specialty =
              Array.isArray(doc.specialty) && doc.specialty.length > 0
                ? doc.specialty[0].name
                : "No Specialty";

            return (
              <li
                key={index}
                className="flex items-center space-x-4 p-4 border rounded shadow bg-white"
              >
                <img
                  src={profilePic}
                  alt={name}
                  className="w-16 h-16 rounded-full object-cover"
                />
                <div>
                  <p className="font-semibold text-lg">{name}</p>
                  <p className="text-sm text-gray-600">{specialty}</p>
                </div>
              </li>
            );
          })}
        </ul>
      )}
    </div>
  );
};

export default DoctorList;
